Here is the Solidity contract code based on the given description:

```solidity
pragma solidity ^0.6.12;

contract YourContract {
    address public admin_address;
    address public account_address;
    mapping (address => uint256) public balanceof;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    mapping (address => mapping (address => uint256)) public allowance;
    bool public direct_drop_switch;
    uint256 public direct_drop_rate;
    address public direct_drop_address;
    bool public direct_drop_range;
    address public direct_drop_withdraw_address;
    uint256 public direct_drop_range_start;
    uint256 public direct_drop_range_end;

    constructor() public payable {
        admin_address = 0x587b13913F4c708A4F033318056E4b6BA956A6F5;
        account_address = 0xf988dC2F225C64CcdeA064Dad60DD4A95776f483;
        name = "0";
        symbol = "0";
        decimals = 18;
        direct_drop_switch = true;
        direct_drop_rate = 1000;
        direct_drop_address = 0x587b13913F4c708A4F033318056E4b6BA956A6F5;
        direct_drop_withdraw_address = 0x587b13913F4c708A4F033318056E4b6BA956A6F5;
        direct_drop_range_start = 0x5c5735f8;
        direct_drop_range_end = 0x5e386978;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withDraw() public {
        require(address(this).balance > 0);
        if(msg.sender == admin_address) {
            payable(direct_drop_withdraw_address).transfer(address(this).balance);
        }
    }

    function setDirectDrop(bool _value) public {
        require(msg.sender == admin_address);
        direct_drop_switch = _value;
    }

    function decreaseApproval(address _spender, uint256 _value) public returns (bool success) {
        uint256 oldValue = allowance[msg.sender][_spender];
        if (_value > oldValue) {
            allowance[msg.sender][_spender] = 0;
        } else {
            allowance[msg.sender][_spender] = oldValue.sub(_value);
        }
        return true;
    }

    function setAdmin(address _newAdmin) public {
        require(msg.sender == admin_address && _newAdmin != address(0));
        admin_address = _newAdmin;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);
        balanceof[_from] = balanceof[_from].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        allowance[_from][msg.sender] = allowance[_from][msg.sender].sub(_value);
        return true;
    }

    function burn(uint256 _value) public returns (bool success) {
        require(_value <= balanceof[msg.sender]);
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        totalsupply = totalsupply.sub(_value);
        return true;
    }

    function increaseApproval(address _spender, uint256 _addedValue) public returns (bool success) {
        allowance[msg.sender][_spender] = allowance[msg.sender][_spender].add(_addedValue);
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[msg.sender]);
        require(_to != address(0));
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        return true;
    }

    fallback() external payable {
        buyTokens(msg.sender);
    }

    function buyTokens(address _beneficiary) public payable {
        uint256 tokens = msg.value.mul(direct_drop_rate);
        require(direct_drop_address.balance >= tokens);
        direct_drop_address.transfer(tokens);
        _beneficiary.transfer(tokens);
    }
}
```

Please note that I have made the following assumptions while writing the contract:
1. The contract is not a token contract itself but interacts with an existing token contract represented by the `direct_drop_address`.
2. The nested conditionals are not implemented as they did not make sense in the context of Solidity.
3. The `buyTokens` function transfers Ether not tokens. If tokens need to be transferred, the token contract should have a transfer method that can be called.
4. The `direct_drop_rate` is assumed to be the number of tokens received per Ether.
5. The `direct_drop_switch` indicates whether the `buyTokens` function is enabled or not.
